"number\\\" id=\\\"height\\\" min=\\\"100\\\" max=\\\"250\\\" placeholder=\\\"Ex: 175\\\"\u003e\\n        \u003clabel\u003eNÃ­vel de Atividade FÃ­sica:\u003c/label\u003e\\n        \u003cselect id=\\\"activity\\\"\u003e\\n            \u003coption value=\\\"1.2\\\"\u003eSedentÃ¡rio - Nenhum exercÃ­cio\u003c/option\u003e\\n            \u003coption value=\\\"1.375\\\"\u003eLevemente Ativo - ExercÃ­cio leve 1-3x por semana\u003c/option\u003e\\n            \u003coption value=\\\"1.55\\\"\u003eModeradamente Ativo - ExercÃ­cio moderado 3-5x por semana\u003c/option\u003e\\n            \u003coption value=\\\"1.725\\\"\u003eMuito Ativo - Treinos intensos diÃ¡rios\u003c/option\u003e\\n            \u003coption value=\\\"1.9\\\"\u003eExtremamente Ativo - Atleta profissional ou trabalho fÃ­sico pesado\u003c/option\u003e\\n        \u003c/select\u003e\\n        \u003clabel\u003eObjetivo:\u003c/label\u003e\\n        \u003cselect id=\\\"goal\\\"\u003e\\n            \u003coption value=\\\"loss\\\"\u003ePerda de Peso\u003c/option\u003e\\n            \u003coption value=\\\"maintenance\\\"\u003eManutenÃ§Ã£o\u003c/option\u003e\\n            \u003coption value=\\\"gain\\\"\u003eGanho de Massa\u003c/option\u003e\\n        \u003c/select\u003e\\n        \u003cbutton onclick=\\\"calculateTMB()\\\"\u003eCalcular\u003c/button\u003e\\n        \u003cbutton onclick=\\\"resetForm()\\\"\u003eLimpar\u003c/button\u003e\\n        \u003cdiv class=\\\"result\\\" id=\\\"result\\\"\u003e\u003c/div\u003e\\n    \u003c/div\u003e\\n    \u003cscript\u003e\\n        function calculateTMB() {\\n            const gender = document.getElementById('gender').value;\\n            const age = parseInt(document.getElementById('age').value);\\n            const weight = parseFloat(document.getElementById('weight').value);\\n            const height = parseFloat(document.getElementById('height').value);\\n            const activity = parseFloat(document.getElementById('activity').value);\\n            const goal = document.getElementById('goal').value;\\n            \\n            if (!age || !weight || !height) {\\n                document.getElementById('result').innerText = \\\"Preencha todos os campos corretamente!\\\";\\n                return;\\n            }\\n            \\n            let tmb = gender === 'male' \\n                ? (10 * weight) + (6.25 * height) - (5 * age) + 5\\n                : (10 * weight) + (6.25 * height) - (5 * age) - 161;\\n            let get = tmb * activity;\\n            \\n            let caloricTargetMin = goal === \\\"loss\\\" ? get - 700 : goal === \\\"gain\\\" ? get + 200 : get;\\n            let caloricTargetMax = goal === \\\"loss\\\" ? get - 500 : goal === \\\"gain\\\" ? get + 500 : get;\\n            let protein = weight * 2;\\n            let fats = caloricTargetMax * 0.25 / 9;\\n            let carbs = (caloricTargetMax - (protein * 4) - (fats * 9)) / 4;\\n            let waterIntake = weight * 0.035;\\n            \\n            document.getElementById('result').innerHTML = `\\n                Sua Taxa MetabÃ³lica Basal (TMB) Ã© \u003cstrong\u003e${tmb.toFixed(2)}\u003c/strong\u003e kcal/dia.\u003cbr\u003e\\n                Considerando seu nÃ­vel de atividade, seu gasto energÃ©tico total (GET) Ã© \u003cstrong\u003e${get.toFixed(2)}\u003c/strong\u003e kcal/dia.\u003cbr\u003e\u003cbr\u003e\\n                Para atingir seu objetivo de \u003cstrong\u003e${goal === 'loss' ? 'Perda de Peso' : goal === 'gain' ? 'Ganho de Massa' : 'ManutenÃ§Ã£o'}\u003c/strong\u003e, sua ingestÃ£o diÃ¡ria deve ficar entre \u003cstrong\u003e${caloricTargetMin.toFixed(2)}\u003c/strong\u003e a \u003cstrong\u003e${caloricTargetMax.toFixed(2)}\u003c/strong\u003e kcal.\u003cbr\u003e\u003cbr\u003e\\n                Seus macronutrientes recomendados sÃ£o:\u003cbr\u003e\\n                - \u003cstrong\u003eProteÃ­na:\u003c/strong\u003e ${protein.toFixed(2)} g\u003cbr\u003e\\n                - \u003cstrong\u003eGorduras:\u003c/strong\u003e ${fats.toFixed(2)} g\u00
